<!doctype html>
<html>
    <head>
        <style>
            @page {
                size: A4 landscape;
                @frame header_frame {
                    -pdf-frame-content: header_container;
                    left: 0pt;
                    height: 60pt;
                }
                @frame content_frame {
                    top: 60pt;
                    padding: 16pt;
                }
                @frame footer_frame {           /* Another static Frame */
                    -pdf-frame-content: footer;
                     top: 575pt; height: 20pt;
                }
            }

            table {
                border-spacing: 0;
                mso-table-lspace: 0pt;
                mso-table-rspace: 0pt;
                padding: 0;
                margin: 0;
            }

            thead, tbody, tr, th, td {
                padding: 0;
                margin: 0;
            }

            img {
                border: none;
                -ms-interpolation-mode: bicubic;
                max-width: 100%;
            }

            body {
                background-color: #ffffff;
                font-family: sans-serif;
                -webkit-font-smoothing: antialiased;
                font-size: 10pt;
                line-height: 1.6;
                margin: 0;
                padding: 0;
                -ms-text-size-adjust: 100%;
                -webkit-text-size-adjust: 100%;
            }

            .container {
                padding: 24pt;
            }

            .header {
                padding-left: 12pt;
                padding-right: 12pt;
                height: 60pt;
            }
            .footer-text {
                font-size: 6pt;
                color: grey;
                text-align: center;
            }
        </style>
        {% block style %}
        {% endblock %}
    </head>
